import React from 'react';
import './Adjust.css'



const Adjust = (props) => {
    return (
        <div className="adjust-main-container">
            <p style={{textAlign: "center"}}>Adjust</p>
            <input type="range" min="0" max="100" className="slider" id="myRange" 
        onChange={(event) => props.draggged(event)}/>
        <span>{props.SliderRange.range}</span>
        </div>
      );
}

export default Adjust;
